			echo -e "\033[31m Plugin: $KOMDNAME \t\t 未被选中	\033[0m \t>>>\t \033[31m 替换失败 \033[0m"
	elif [ $command3 -eq 0 ];then
			echo -e "\033[32m Plugin: $KOMDNAME is selected!	\033[0m"
	else
		echo -e "\033[31m ERROR: $KOMDNAME \t\t 未找到	\033[0m"
	fi
	grep "CONFIG_PACKAGE_$KOMDNAME=y" $filename >> /tmp/tmp.log
}

